import React from 'react';
import './card.css';
import './card_json.js';

class Card extends React.Component(){
  render(){
    return(
      <div className="card-deck ml-4">
        <div className="card cardhome col-12 col-md-3">
              {CardItem.map((item,index) => {
                return(
                  <div key={index} className="card-body text-center ">
                    <span className="card-title num">{item.number}</span>
                    <p className="card-text mt-4">{item.text}</p>
                    <a className="display-4"  href={item.url}>
                      <i className={item.icon}></i>
                    </a>
                    <a href={item.url} className="card-footer btn btn-light mt-5">{item.footer}</a>
                  </div>
                  )
                })}
         </div>
      </div>
    )
  }  
  }


export default Card;
